unsigned char decrypted_firmware[FIRMWARE_SIZE];

unsigned char password_hash[] = "\x24\xd7\x71\x64\x40\x39\x69\x2c\x60\xf2\x7a\x49\x2e\x51\x22\x2e\xe5\x4c\xd8\xc2";
unsigned int PASSWORD_HASH_LEN = 20;

// encryptDecrypt() function from https://github.com/KyleBanks/XOREncryption/blob/master/C/main.c
void decrypt(unsigned char * key) {
	unsigned int firmware_len = FIRMWARE_SIZE;
	unsigned int key_len = strlen(key);

	int i;
	for(i = 0; i < firmware_len; i++) {
		decrypted_firmware[i] = firmware[i] ^ key[i % (strlen(key)/sizeof(char))];
	}

	/*
	 * FOR DEBUGGING:
	for (int i = 0; i < firmware_len; i++) {
		printf("\\x%02x", decrypted[i]);
	}
	printf("\n");
	*/
}

/* DumpHex() function from https://gist.github.com/ccbrown/9722406 */
void dump_hex(unsigned char * data, size_t size) {
	char ascii[17];
	size_t i, j;
	ascii[16] = '\0';
	for (i = 0; i < size; ++i) {
		printf("%02X ", ((unsigned char*)data)[i]);
		if (((unsigned char*)data)[i] >= ' ' && ((unsigned char*)data)[i] <= '~') {
			ascii[i % 16] = ((unsigned char*)data)[i];
		} else {
			ascii[i % 16] = '.';
		}
		if ((i+1) % 8 == 0 || i+1 == size) {
			printf(" ");
			if ((i+1) % 16 == 0) {
				printf("|  %s \n", ascii);
			} else if (i+1 == size) {
				ascii[(i+1) % 16] = '\0';
				if ((i+1) % 16 <= 8) {
					printf(" ");
				}
				for (j = (i+1) % 16; j < 16; ++j) {
					printf("   ");
				}
				printf("|  %s \n", ascii);
			}
		}
	}

	return;
}

unsigned long parse_dumphex_args(char * arg) {
	char ** end = (char **) arg + strlen(arg);
	unsigned long arg_value = strtoul(arg, end, 10);
	return arg_value;
}

int parse_command(unsigned char * command_line) {
	unsigned char * command_token = NULL;
	unsigned char * command_tokens = (unsigned char *) malloc(MAX_BUF_SIZE);
	unsigned int num_tokens = 0;

	memset(command_tokens, '\0', MAX_BUF_SIZE);
	memcpy(command_tokens, command_line, MAX_BUF_SIZE - 1);
	
	command_token = strtok(command_tokens, " ");
	while (command_token = strtok(NULL, " ")) {
		num_tokens += 1;
	}

	if (num_tokens == 2) {
		unsigned char * command = command_tokens;
		unsigned char * arg1 = command + strlen(command) + 1;
		unsigned char * arg2 = arg1 + strlen(arg1) + 1;
		if (strcmp(command, "dumphex") == 0) {
			unsigned long arg1_value = parse_dumphex_args((char *) arg1);
			unsigned long arg2_value = parse_dumphex_args((char *) arg2);
			unsigned char * hexdump_ptr = (unsigned char *) decrypted_firmware + arg1_value;

			if (arg2_value > MAX_BUF_SIZE) {
				arg2_value = MAX_BUF_SIZE;
			}

			dump_hex(hexdump_ptr, (size_t) arg2_value);

			free(command_tokens);
			command_tokens = NULL;
			return 0;
		}
	}

	free(command_tokens);
	command_tokens = NULL;
	return -1;
}

int screen_session() {
	unsigned char * command_line = (unsigned char *) malloc(MAX_BUF_SIZE);

	printf("Logged into the screen session, type \"help\" without quotes to see the list of available commands!\n");
	printf("> ");
	while (fgets(command_line, MAX_BUF_SIZE - 1, stdin) != 0) {
		command_line[strlen(command_line) - 1] = '\0';

		if (parse_command(command_line) == 0) {
			printf("> ");
			continue;
		}

		if (strcmp(command_line, "help") == 0) {
			printf("Commands available are: help, quit, dumphex\n");
		} else if (strcmp(command_line, "quit") == 0) {
			printf("\nQuitting...\n");
			free(command_line);
			command_line = NULL;
			return 0;
		} else if (strcmp(command_line, "dumphex") == 0) {
			printf("\nUsage: dumphex offset number_of_bytes\n");
		} else {
			printf("\n %s is an unrecognized command\n", command_line);
		}

		printf("> ");
	}

	return -1;
}

int init_login(unsigned char ** username, unsigned char ** password) {

	*username = (unsigned char *) malloc(MAX_BUF_SIZE);
	*password = (unsigned char *) malloc(MAX_BUF_SIZE);

	if (username == NULL || password == NULL) {
		puts("Error, malloc failed\n");
		free(username);
		free(password);
		username = NULL;
		password = NULL;
		return -1;
	}

	return 0;
}

int login_prompt(unsigned char ** username, unsigned char ** password) {
	printf("Username: ");
	fgets(*username, MAX_BUF_SIZE - 1, stdin);
	*(*username + strlen(*username) - 1) = '\0';

	printf("Password: ");
	fgets(*password, MAX_BUF_SIZE - 1, stdin);
	*(*password + strlen(*password) - 1) = '\0';

	size_t length = strlen(*password);
        unsigned char hash[SHA_DIGEST_LENGTH];
        SHA1(*password, length, hash);

	if (strcmp(*username, "root") == 0 
			&& memcmp(hash, password_hash, PASSWORD_HASH_LEN) == 0) {
		puts("Successfully logged in!\n");
		decrypt(*password);
		if(screen_session() == 0) {
			free(*username);
			free(*password);
			*username = NULL;
			*password = NULL;
		}
		return 0;
	} else {
		return -1;
	}
}

void main(int argc, char * argv[]) {
	unsigned char * username;
	unsigned char * password;
	unsigned int login_attempts;

	// turn off buffered I/O
	setbuf(stdin, NULL);
	setbuf(stdout, NULL);

	if (init_login(&username, &password) < 0) {
		exit(-1);
	}

	while (login_prompt(&username, &password) != 0 
			&& login_attempts < 5) {
		puts("Login failed!\n");
		login_attempts += 1;
	}

	if (login_attempts >= 5) {
		puts("Maximum login attempts exceeded! Exiting...\n");
		free(username);
		free(password);
		username = NULL;
		password = NULL;
		exit(-1);
	}
}
